import React from "react";

interface Props {
    size?: "very-small" | "small" | "medium" | "large";
}

export const Logo = ({ size = "medium" }: Props) => {

    let sizeLogo: number;

    switch (size) {
        case "very-small":
            sizeLogo = 34;
            break;
        case "small":
            sizeLogo = 61;
            break;
        case "medium":
            sizeLogo = 88;
            break;
        case "large":
            sizeLogo = 140;
            break;
    }
    return (<div>
        <svg
            width={sizeLogo}
            viewBox="0 0 227 228"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
        >
            <rect width="227" height="228" fill="#F5F5F5" />
            <rect width="227" height="228" fill="url(#pattern0_0_1)" />
            <rect width="227" height="228" fill="black" fill-opacity="0.2" />
            <defs>
                <pattern id="pattern0_0_1" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlinkHref="#image0_0_1" transform="scale(0.00440529 0.00438596)" />
                </pattern>
                <image id="image0_0_1" width="227" height="228" xlinkHref="data:image/png;base64," />
            </defs>
        </svg>

    </div>

    )
}